DROP TABLE IF EXISTS `t_sys_menu`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_sys_menu` (
  `m_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `m_menu_code` varchar(255) DEFAULT NULL COMMENT '菜单编码',
  `m_menu_icon` varchar(100) DEFAULT NULL COMMENT '菜单图标',
  `m_menu_title` varchar(100) NOT NULL COMMENT '资源标题，即资源名',
  `m_menu_type` int(5) unsigned NOT NULL COMMENT '资源类型：1->目录 2->菜单 3->按钮',
  `m_description` varchar(225) DEFAULT NULL,
  `m_menu_sort` int(11) DEFAULT NULL COMMENT '菜单排序',
  `m_pid` bigint(20) unsigned NOT NULL COMMENT '父资源id, 根菜单pid:0',
  `m_permission` varchar(255) DEFAULT NULL COMMENT 'Spring Security使用Spring EL表达式对URL或方法进行权限控制',
  `m_access_url` varchar(255) DEFAULT NULL COMMENT '访问后端系统url',
  `m_router_path` varchar(100) DEFAULT NULL COMMENT '菜单路由地址，前端菜单路由跳转用',
  `m_is_external_link` bit(1) DEFAULT b'0' COMMENT '是否是外部连接',
  `m_is_hidden` bit(1) DEFAULT b'1',
  `m_creator` varchar(100) NOT NULL,
  `m_updater` varchar(100) DEFAULT NULL,
  `m_create_time` datetime NOT NULL,
  `m_update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`m_id`),
  UNIQUE KEY `t_sys_menu_m_menu_code_uindex` (`m_menu_code`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='页面菜单表';
